/** @format */

import React from "react";
import { useState } from "react";

const GroupchatContainer = ({ groupChatName, changeChat }) => {
	const [groupSelected, setGroupSelected] = useState(undefined);
	const changeGroupChat = (index, groupChatName) => {
		setGroupSelected(index);
		changeChat(groupChatName);
	};

	return <div>GroupchatContainer</div>;
};

export default GroupchatContainer;
